import { useState, useEffect } from "react";
import Axios from "axios";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Container,
  Table,
  Button,
  DropdownButton,
  Dropdown,
} from "react-bootstrap";

export default function Info() {
  const api = "http://127.0.0.1:3001";

  const [users, setUsers] = useState([]);
  const [selectedType, setSelectedType] = useState("all");

  useEffect(() => {
    Axios.get(`${api}/users`).then((res) => {
      setUsers(res.data);
    });
  }, []);

  const openImage = (e, imageUrl) => {
    e.preventDefault();
    window.open(imageUrl, "_blank");
  };

  const handleTypeSelect = (type) => {
    setSelectedType(type);
  };

  const filteredUsers =
    selectedType === "all"
      ? users
      : users.filter((user) => user.type === selectedType);

  return (
    <Container className="py-5">
      <header>
        <nav className="navbar navbar-expand-lg navbar-light bg-light mb-5">
          <div className="container-fluid">
            <a className="navbar-brand" href="/">
              Admin
            </a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav">
                <li className="nav-item">
                  <a className="nav-link" href="/app">
                    User
                  </a>
                </li>
                <li className="nav-item">
                  <a className="nav-link active" href="/app">
                    User Info
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </header>
      <div className="d-flex justify-content-end mb-3">
        <DropdownButton
          id="dropdown-basic-button"
          title={`Filter by Type: ${selectedType}`}
        >
          <Dropdown.Item onClick={() => handleTypeSelect("all")}>All</Dropdown.Item>
          <Dropdown.Item onClick={() => handleTypeSelect("Student")}>
            Student
          </Dropdown.Item>
          <Dropdown.Item onClick={() => handleTypeSelect("Graduate")}>
            Graduate
          </Dropdown.Item>
          <Dropdown.Item onClick={() => handleTypeSelect("Employed")}>
            Employed
          </Dropdown.Item>
        </DropdownButton>
      </div>

      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Type</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {filteredUsers.map(({ _id, name, phone, email, type, imageUrl }) => {
            return (
              <tr key={_id}>
                <td>{name}</td>
                <td>{email}</td>
                <td>{phone}</td>
                <td>{type}</td>
                <td>
                  {imageUrl && (
                    <Button
                      variant="link"
                      onClick={(e) => openImage(e, imageUrl)}
                    >
                      View Image
                    </Button>
                  )}
                </td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </Container>
  );
}
